O mundo precisa de socorro, ainda mais neste período de pandemia! Praticar o desenvolvimento sustentável significa suprir as necessidades do presente sem afetar as gerações futuras. Há um conjunto de ações que podemos praticar em nosso dia a dia, atos simples que resultam em benefícios transformadores.
Adote ações como este projeto do Ministério Público do Trabalho, que eu apoio, #Faces&Sustentabilidade: 
- Compre produtos orgânicos diretamente de pequenos produtores;
- Contribua para o combate à fome distribuindo alimentos nutritivos e saudáveis para manter o isolamento em comunidades carentes. 
- Compre mercadorias diretamente da economia criativa por meio do fiquenolar.com; 
- Capacite e ofereça trabalho para populações vulneráveis, como pessoas transexuais, imigrantes e refugiados, dando visibilidade a estas comunidades;
- Promova o trabalho digno; 

Estas medidas contribuem para a erradicação do trabalho escravo, para a ausência de discriminação e para o enfretamento ao tráfico de pessoas!

#AdoteAçõesInclusivasSustentáveis 

